            if (StringUtils.isNotEmpty(state)) {
                builder.queryParam("state", state);
            }
            // cache auth code
            AuthCodeCacheHandler.getInstance().put(key, code);
            mav.setViewName("redirect:" + builder.toUriString());
            return mav;
